from befree.api_model.config.headers import Headersfrom befree.api_model.catalog.private.compilations.endpoints import Endpointsfrom befree.api_model.catalog.private.compilations.payloads import Payloadsfrom befree.api_model import apifrom requests import Responseclass Compilations:    def __init__(self):        self._endpoints = Endpoints()        self._payloads = Payloads()        self._headers = Headers()    def get_list(self):        response: Response = api.private_session.get(            url=self._endpoints.get_list        )        return response    def get(self, compilation_id):        response: Response = api.private_session.get(            url=self._endpoints.get(compilation_id=compilation_id)        )        return response    def update(self, compilation_id, title, slug, **kwargs):        response: Response = api.private_session.put(            url=self._endpoints.update(compilation_id=compilation_id),            data=self._payloads.update(title=title, slug=slug, **kwargs),            headers=self._headers.common,        )        return response    def create(self, title, slug, **kwargs):        response: Response = api.private_session.post(            url=self._endpoints.create,            data=self._payloads.create(title=title, slug=slug, **kwargs),            headers=self._headers.common,        )        return response    def delete(self, compilation_id):        response: Response = api.private_session.delete(            url=self._endpoints.delete(compilation_id=compilation_id),            headers=self._headers.common,        )        return response